import Appbar from "../components/Appbar";
import HomeStruct from "../components/HomeStruct";

function Home() {
  return (
    <div style={{ backgroundColor: "#388e3c" }}>
      <Appbar></Appbar>
      <HomeStruct></HomeStruct>
    </div>
  );
}

export default Home;
